// src/App.js
import React from 'react';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Home from './components/Home';
import DeviceList from './components/DeviceList';
import DeviceInsert from "./components/DeviceInsert";
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import DeviceUpdate from "./components/DeviceUpdate";


function App() {
    return (
        <Router>
            <div className="App">
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/insert-device" element={<DeviceInsert />} />
                    <Route path="/device-list" element={<DeviceList />} /> {/* Add DeviceList route */}
                    <Route path="/update-device" element={<DeviceUpdate />} /> {/* Page to select device to update */}
                    <Route path="/update-device/:id" element={<DeviceUpdate />} /> {/* Actual update form */}
                    <Route path="/delete-device" element={<DeviceDelete />} /> {/* Page to delete a device */}

                </Routes>
            </div>
        </Router>
    );
}

export default App;
